import { Outlet, Link } from "react-router-dom";
import './static/Layout.css'
const Layout = () => {
  return (
    <>
      <nav>
        <div>
          <div></div>
       
        
            <Link to="/">Post</Link>
          
          
            <Link to="/view">View</Link>
          
          
            <Link to="/category">Category</Link>
          
          
            <Link to="/subcategory">Sub Category</Link>
          
        </div>
      </nav>

      <Outlet />
    </>
  )
};

export default Layout;
